import React from 'react';
import Foreigner from './Foreigner';

const Home = () => {

  return (
    <>
      <h1>This is Sparta!!</h1>
      <h1>
        <Foreigner name="Vinayak Santhosh" />
      </h1>
      <Link to={{ pathname: '/', state: { backgroundcolor: txtstyle.backgroundcolor } }}>
        {/* Your logo and app name */}
      </Link>
    </>
  );
};

export default Home;
